INSERT INTO `think_notice` VALUES (5,'雪莲花激活调整公告','尊敬的黄金家园玩家：\n自瑞雪女神上线以来，‘雪莲花’深受玩家热捧，但是由于数量有限，导致有些玩家无法体验雪莲花功能。为了游戏公平，至2017年6月17日12点起，玩家在激活瑞雪女神时，不再输入验证码，但每个玩家点击激活时有概率激活失败，如果激活失败当天则无法再次完成激活，只有等到第二天12点时才可以再次激活，每天都有概率成功或者失败，激活概率对每个玩家都是公平公正，请大家遵守游戏规则！\n备注：雪莲花的个人等级次数和系统计算当日全服可激活次数规则不变！',NULL,0,NULL),(6,'关于开放青土地8级专属作物交易公告','各位淘金农友：\n自青土地专属作物上线以来，新专属作物深受玩家热捧。随着百合花产出数量不断增加，为加大市场的活跃度，因此平台决定于2017年7月17日9:00开放百合花的交易！\n青土地专属作物‘百合花’按照10的倍数进行交易，按照1的倍数进行赠送！\n特此公告！',NULL,0,'2017-07-17 17:01:01'),(7,'《黄金家园》‘惠农果‘兑换方式','《黄金家园》近期推出‘玩“黄金家园”，免费兑换有机无公害水果’活动，现公布兑换详细地址和流程： 进入电商网站后，在右上角选择“黄金家园账号登陆”，登陆后在主页标签最右边选择“兑换”（手机打开需要点击右侧三个点点），点击进去可以使用“惠农果”限时8折兑换绿宝石梨，输入收货信息后，即可完成兑换！\n为了让每个玩家都能品尝到《黄金家园》线下的果实，我们将加大游戏里面“惠农果”的产量，除了以前的产出概率提高以外，在兑换钻石时可以100%获得大量“惠农果”，每天限量10000个惠农果，每天早上7点重置数量，先充先',NULL,0,'2017-07-17 17:03:18'),(8,'《黄金家园》迎接“一周年庆典”新版本正式开启','《黄金家园》走过了一年的风雨里程，一直秉承“用户至上”的思想，为了让《黄金家园》稳定健康长期的发展，经过一年的市场监测，当前种子循环产生、限制作物涨跌幅的模式已不再适应后续的市场变化，特将以上两点进行优化调整，让《黄金家园》更趋向市场化，透明化、自由化！\n种子规则调整如下：\n1、 官方游戏商店根据等级每天限量供应系统回收的‘种子’：\n1111.png\n2、 种子的购买价格根据农贸市场最低作物价值来决定。\n3、 果园的农贸市场也将下架‘种子’的交易列表和相关数据。\n4、 种子重生途径调整到游戏‘商店’中点击',NULL,0,'2017-07-17 17:36:26');
